text:
"I think, you can cover more topics(I like going in-depth):
0. Extremely slow animation (can be fixed by "reduce motion" settings);
1. Still no USB-C;
2. No dark skin for OLED (except of "smart invert colors" feature);
3. No hide notch options. I would like to choose between: symmetric notch, rounded corners, compatibility mode.
PS there are enormous amount of content to talk about: hacks and tweaks for iOS and MacOS, productivity... why most you tubers are making unboxing videos and talking about phone specs?
+1 for "this show how it's important in 2017" phrase, totally make cense."

